import React from "react";

import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faClock} from "@fortawesome/free-solid-svg-icons";


function WoodBlock(props) {

    return (
        <div className={"prof-block pointer "} >

            <br/>
            <small>Cut</small>
            <br/>
            <span>{props.title}</span>
            <br/>
            <small>
                <span>{props.xp} XP</span>
                /
                <span><FontAwesomeIcon icon={faClock} /> </span>
                <span>{props.cutTime} seconds</span>
            </small>
            <br/>
            <img src="https://cdn.melvor.net/core/v018/assets/media/skills/woodcutting/normal_tree.svg" width="65px"></img>
            </div>
    );
}

export default WoodBlock;
